import React from 'react';
import { Link } from 'react-router-dom';

function PreLandingPage() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to Our Service</h1>
      <p>Please log in or sign up to continue.</p>
       <Link to="/login" style={{ marginRight: '10px', padding: '10px', backgroundColor: '#4CAF50', color: 'white', textDecoration: 'none', borderRadius: '5px' }}>Login</Link>
      <Link to="/signup" style={{ padding: '10px', backgroundColor: '#008CBA', color: 'white', textDecoration: 'none', borderRadius: '5px' }}>Sign Up</Link> 
    </div>
  );
}

export default PreLandingPage;
